import{_ as i,o as e,c as t,O as o}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 23.1-2310 Authority to create Virginia Commonwealth University School of Medicine-Northern Virginia Division.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/23.1-2310.md","filePath":"vacode/23.1-2310.md"}'),r={name:"vacode/23.1-2310.md"},a=o('<h1 id="§-23-1-2310-authority-to-create-virginia-commonwealth-university-school-of-medicine-northern-virginia-division" tabindex="-1">§ 23.1-2310 Authority to create Virginia Commonwealth University School of Medicine-Northern Virginia Division. <a class="header-anchor" href="#§-23-1-2310-authority-to-create-virginia-commonwealth-university-school-of-medicine-northern-virginia-division" aria-label="Permalink to &quot;§ 23.1-2310 Authority to create Virginia Commonwealth University School of Medicine-Northern Virginia Division.&quot;">​</a></h1><p>A. The board may establish the Virginia Commonwealth University School of Medicine-Northern Virginia Division (the Division). If established, the board shall operate the Division in the areas of program and service emphasis that the Council approves pursuant to subdivision 7 of § <a href="http://law.lis.virginia.gov/vacode/23.1-203/" target="_blank" rel="noreferrer">23.1-203</a>.</p><p>B. The board has the same powers with respect to the operation of the Division as are vested in the board regarding the University.</p><p>2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0694" target="_blank" rel="noreferrer">694</a>, § 23-50.16:01; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0588" target="_blank" rel="noreferrer">588</a>.</p>',4),n=[a];function s(h,c,l,d,v,_){return e(),t("div",null,n)}const m=i(r,[["render",s]]);export{g as __pageData,m as default};
